package stalbans.inertiagames;import java.awt.*;public class DynatrackGameEmbed extends SquareGameBoard {	public String getTitle() {		return "Dynatrack";	}		public String getInstructionsLoc() {		return "text/dynatrack.html";	}		public void setupCardHook() {		instructionsPane.setSize(new java.awt.Dimension(510, 140));		instructionsPane.setLocation(new java.awt.Point(20, 345));		replayButton.setLocation(new java.awt.Point(430, 290));		menuButton.setLocation(new java.awt.Point(430, 320));		repaint();	}	public RocketPanel newGamePanel() throws Exception {		return new DynatrackPanel(this);	}		public Rocket newStartingRocket() {		int rockettempx = (gamePanel.getWidth() / 2) + 105;		int rockettempy = (gamePanel.getHeight() / 2);		return new Rocket(rockettempx, rockettempy, 0, 1);	}		public void initGamePanelHook() {		gamePanel.setSize(new java.awt.Dimension(400, 300));		gamePanel.setLocation(new java.awt.Point(20, 40));		((DynatrackPanel)gamePanel).setRadii(70,140);	}	}